import{_ as p,c as t,a3 as a,o as r}from"./chunks/framework.DDs3IadZ.js";const m=JSON.parse('{"title":"2023/06/22","description":"","frontmatter":{},"headers":[],"relativePath":"trip/journey/20230622.md","filePath":"trip/journey/20230622.md","lastUpdated":1726815910000}'),o={name:"trip/journey/20230622.md"};function n(s,e,i,d,c,l){return r(),t("div",null,e[0]||(e[0]=[a('<h1 id="_2023-06-22" tabindex="-1">2023/06/22 <a class="header-anchor" href="#_2023-06-22" aria-label="Permalink to &quot;2023/06/22&quot;">​</a></h1><p>12:09-12:14 骑自行车到大运河 12:15-12:42 地铁可坐5-2附近（车厢-车门）方便换乘1号线，中转刚好2分钟1号线就来了。</p><p>从东口进，如果没有晚点还是非常极限的。插队进来，12:52进来。原本12:56发车，是赶不上的。正好晚点了14分钟。全是人这里。</p><p>G1348 12:56-13:42 到杭州东晚点了14分钟，实际到达13:57。12车厢刚好在出口位置，直接出来。有点饿，整碗面吃。</p><p>兰州拉面，二宽！老板“没有二宽，只有宽细”，一份宽的。等餐ing，4分钟就好了，光速吃完。</p><p>地铁，正好车来了，然后没看终点站在哪。14:13上车，上来才知道，终点站广兰路。这车里面，还没有显示屏显示到哪了，只有广播，坐的迷迷糊糊。到世纪大道站的时候，广播说“因广兰路换乘受限”，让在广兰路任意一个之前的车站换乘终点站为浦东的车…世纪公园下车，等开往浦东的列车，不需要很久，2分钟。</p><p>地铁开的速度一直是60-70km/h 还是有些焦灼的，15:53 到浦东机场站。耗时1小时40分钟，跟地图预计的时间是一样的。</p><p>15:58 走上来，在F区，国内安检在B区附近。16:06安检完，人没有很多，很快。</p><p>16:12坐接驳线去登机口，3分钟到达，坐电梯上来，去接了点水，喝了一些。又去了厕所，然后手机提示登机了。以为登机口很近，一路都疾走，到登机口，直接头等舱登机。</p><p>17:02 开始滑行，滑行到17:13，然后在等着，别人插队了？不晓得，17:16又开始滑行，就是排队太靠后了，17:26加油冲，速度到260就飞起来了。</p><p>头等舱的服务还是很不错的，旁边坐了一个老外，还以为这个老外是买的全程航班飞往乌鲁木齐的。没想到后面他也在南阳下车了。</p><p>爸妈来机场接我，然后一路走高速回家去吃了一个许家焖鸡，点了三个菜，一个焖鸡，一个回锅肉，一个烧茄子。量非常大，三个人根本吃不完。</p>',12)]))}const u=p(o,[["render",n]]);export{m as __pageData,u as default};
